class RedShifting:
    def __init__(self, fitsfile, redshift, FRI, middle_position):
        """
        :param fits: fits file location
        :param redshift: redshift
        :param FRI: FRI==True, FRII=False
        :param middle_position: middle point in image
        """
        self.hdul = fits.open(fitsfile)[0]
        self.redshift = redshift
        self.cosmo = FlatLambdaCDM(H0=70 * u.km / u.s / u.Mpc, Tcmb0=2.725 * u.K, Om0=0.3)

        # self.fluxlim = Ftheta_to_Lpc(75e-5, 0.8, self.beam)
        self.fluxlim = 75e-5
        self.FRI = FRI  # True or False
        self.poly_list = None
        self.hdul.header['CRVAL1'], self.hdul.header['CRVAL2'] = middle_position
        self.hdul.header['CRPIX1'], self.hdul.header['CRPIX2'] = len(self.hdul.data) / 2, len(self.hdul.data) / 2
        self.current_header = self.hdul.header
        self.pix_scaling = 1

    @property
    def beam_area(self):
        """
        Calculate beam area with:
        Beam Area = 2 * pi * sigma^2
        FWHM = 2 * sigma * sqrt(2*ln(2))
        Number of pixels in a beam = beam area [arcsec]/(pixel length)^2
        https://www.eaobservatory.org/jcmt/faq/how-can-i-convert-from-mjybeam-to-mjy/
        """
        gfactor = 2 * np.sqrt(2*np.log(2))
        FWHM = np.sqrt(((self.hdul.header['BMAJ'] * u.deg).to(u.arcsec).value * (self.hdul.header['BMIN'] * u.deg).to(u.arcsec).value)) # Remote Lofar stations
        sigma = FWHM/gfactor
        pix_length = (self.hdul.header['CDELT2'] * u.deg).to(u.arcsec).value
        return 2 * np.pi * sigma**2 / pix_length ** 2 # pixels per beam

    def Ftheta_to_Lpc(self, im, z):
        """
        Flux density to Luminosity
        :param im: image data
        :param z: redshift
        :return: Luminosity
        """
        return im * (1/self.beam_area) * 10 ** (-26) * 4 * np.pi * (1 + z) ** (0.7 - 1) * (1 + z) ** 4 / (
                ((1.5 * u.arcsec.to(u.rad)) * (1 * u.m).to(u.pc).value) ** 2)


    def shift(self, dz=0, save_as=''):
        """
        Shift image
        :param dz: delta redshift
        :param save_as: file name if you want to save
        :return: shifted image
        """
        clipped_back = sigma_clip(self.hdul.data, 5, masked=True, maxiters=10)
        rms_I = np.std(clipped_back)

        self.pix_scaling = (self.cosmo.luminosity_distance(z=self.redshift + dz).value * (1 + self.redshift) ** 2) / (
                self.cosmo.luminosity_distance(z=self.redshift).value * (1 + self.redshift + dz) ** 2)
        pix_scaling = (self.cosmo.luminosity_distance(z=self.redshift + dz).value * (1 + self.redshift) ** 2) / (
                self.cosmo.luminosity_distance(z=self.redshift).value * (1 + self.redshift + dz) ** 2)

        new_header = self.hdul.header.copy()
        new_header['NAXIS1'], new_header['NAXIS2'] = int(len(self.hdul.data) // pix_scaling), int(len(self.hdul.data) // pix_scaling)
        new_header['CRPIX1'], new_header['CRPIX2'] = len(self.hdul.data) / (2 * pix_scaling), len(self.hdul.data) / (2 * pix_scaling)
        new_header['CDELT1'] *= pix_scaling
        new_header['CDELT2'] *= pix_scaling
        image, _ = reproject_adaptive(self.hdul, new_header)
        image = image * ((1 + self.redshift) / (1 + self.redshift + dz)) ** 4
        new_header.append('RMS', end=True)
        new_header['RMS'] = rms_I
        self.current_header = new_header
        if save_as:
            fits.writeto(save_as, image, new_header, overwrite=True)
        return image

    def make_image(self, dz, save_as='', video=False):
        """
        Make image of source
        :param dz: delta z
        :param save_as: name of image
        :param video: make image for video
        :return:
        """
        image_data = self.shift(dz)
        if video:
            while image_data.shape[0]%2==1: # we need oneven size otherwise the video will be jizzy
                dz+=0.001
                image_data = self.shift(dz)
        plt.imshow(image_data, norm=SymLogNorm(linthresh=np.nanstd(self.hdul.data), vmin=0.1*np.nanstd(self.hdul.data),
                                               vmax=np.nanstd(self.hdul.data) * 20), cmap='CMRmap')
        plt.title(np.round(dz, 3))
        plt.tight_layout()
        plt.grid(False)
        plt.axis('off')
        if save_as:
            plt.savefig(save_as)
        else:
            plt.show()
        plt.close()

    def make_video(self, dz_max, save_as=''):
        """
        Make a video with ffmpeg
        :param dz_max: max delta z
        :param save_as: file name
        :return:
        """
        frame_dz = np.linspace(0, dz_max, 100)
        os.system('mkdir video_frames')
        for n, dz in enumerate(tqdm(frame_dz)):
            self.make_image(dz, f'video_frames/frame_{str(n).rjust(5, "0")}.png', video=True)
        if not save_as:
            save_as='movie.mp4'
        os.system(f'ffmpeg -f image2 -r 10 -start_number 0 -i video_frames/frame_%05d.png {save_as} && rm -rf video_frames')


